import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles((theme) => ({
  div: {
    paddingTop: 20,
    marginLeft: 25,
    marginBottom: -15,
  },
  logoBox: {
    marginTop: '4%'
  },
  accountHeader: {
    fontSize: '110px',
    fontWeight: 'bold',
    fontFamily: 'Open Sans'
  }
}));
